import React from 'react';

class Timer extends React.Component {

    constructor(props) {
        super(props);  

        this.state = { 
            whiteTimer: "10",
            blackTimer: "10",
             };  

    }

    render()
    {
        return (
            <>
                <p>{this.state.whiteTimer}</p>
                <p>{this.state.blackTimer}</p>
            </>

        );
    }
}

export default Timer;
